css:
body {
  font-size: 11px;
  color: #c0b18b;
  background-color: #0a0a0a;
}
atom-pane {
  border-right: 1px solid #030303;
}
atom-pane:last-child {
  border-right: none;
}
.btn {
  color: #cbbe9f;
  background-color: #313131;
}
.btn:hover,
.btn:focus {
  color: #ae9b6a;
  background-color: #4f4f4f;
}
.btn:active {
  color: rgba(174, 155, 106, 0.66);
  background-color: #2b2b2b;
}
.btn.selected {
  color: #ae9b6a;
  background-color: #4f4f4f;
}
.btn:focus,
.btn:focus:active {
  outline: none;
}
.btn.btn-primary {
  color: #ae9b6a;
  background-color: #535c5c;
}
.btn.btn-primary:hover,
.btn.btn-primary:focus {
  background-color: #5d6767;
}
.btn.btn-primary:active {
  background-color: #495151;
}
.btn.btn-primary.selected {
  background-color: #5d6767;
}
.btn.btn-primary.selected:focus,
.btn.btn-primary.selected:hover {
  background-color: #667171;
}
.btn.btn-info {
  color: #ae9b6a;
  background-color: #535c5c;
}
.btn.btn-info:hover,
.btn.btn-info:focus {
  background-color: #5d6767;
}
.btn.btn-info:active {
  background-color: #495151;
}
.btn.btn-info.selected {
  background-color: #5d6767;
}
.btn.btn-info.selected:focus,
.btn.btn-info.selected:hover {
  background-color: #667171;
}
.btn.btn-success {
  color: #ae9b6a;
  background-color: #6d715e;
}
.btn.btn-success:hover,
.btn.btn-success:focus {
  background-color: #787c67;
}
.btn.btn-success:active {
  background-color: #626655;
}
.btn.btn-success.selected {
  background-color: #787c67;
}
.btn.btn-success.selected:focus,
.btn.btn-success.selected:hover {
  background-color: #828771;
}
.btn.btn-warning {
  color: #ae9b6a;
  background-color: #d17b49;
}
.btn.btn-warning:hover,
.btn.btn-warning:focus {
  background-color: #d58759;
}
.btn.btn-warning:active {
  background-color: #cd6f39;
}
.btn.btn-warning.selected {
  background-color: #d58759;
}
.btn.btn-warning.selected:focus,
.btn.btn-warning.selected:hover {
  background-color: #d9936a;
}
.btn.btn-error {
  color: #ae9b6a;
  background-color: #4a3637;
}
.btn.btn-error:hover,
.btn.btn-error:focus {
  background-color: #563f40;
}
.btn.btn-error:active {
  background-color: #3e2d2e;
}
.btn.btn-error.selected {
  background-color: #563f40;
}
.btn.btn-error.selected:focus,
.btn.btn-error.selected:hover {
  background-color: #624749;
}
.btn-group > .btn {
  border-color: rgba(0, 0, 0, 0.2);
}
atom-text-editor[mini] {
  padding-left: 5px;
  color: #c0b18b;
  border-radius: 0;
  background-color: #0a0a0a;
}
atom-text-editor[mini].is-focused {
  background-color: #000000;
}
atom-text-editor[mini] .placeholder-text,
atom-text-editor[mini]::shadow .placeholder-text {
  color: #847348;
}
atom-text-editor[mini] .selection .region,
atom-text-editor[mini]::shadow .selection .region {
  background-color: #313131;
}
.find-and-replace {
  border-top: 1px solid #030303;
}
.status {
  color: #c0b18b;
}
.status-added {
  color: #8a9851;
}
.status-ignored {
  color: #847348;
}
.status-modified {
  color: #b7936b;
}
.status-removed {
  color: #866264;
}
.status-renamed {
  color: #5f6969;
}
.key-binding {
  display: inline-block;
  margin-left: 1px;
  padding: 0 5px;
  line-height: 2;
  font-family: 'Helvetica Neue', Arial, sans-serif;
  font-size: .8em;
  letter-spacing: 1px;
  border-radius: 0;
  background-color: #0a0a0a;
}
.list-group li {
  padding-left: 5px;
}
.list-group li.selected {
  color: #ae9b6a;
  background-color: #313131;
}
.list-group li.selected:before {
  display: none;
}
.list-tree .selected {
  color: #ae9b6a;
}
.select-list li {
  padding: 5px 10px;
}
.select-list .status {
  float: right;
}
.select-list.popover-list {
  padding: 5px;
  border-radius: 0;
  background-color: #242424;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.select-list.popover-list .list-group {
  margin-top: 5px;
}
.select-list.popover-list .list-group li {
  padding-left: 5px;
}
.panel-heading {
  border-bottom: 1px solid #030303;
  background-color: #212121;
}
.inset-panel {
  background-color: #212121;
}
.inset-panel .panel-heading {
  background-color: #2b2b2b;
}
atom-panel.modal {
  border: 1px solid #030303;
  border-top: none;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.loading-spinner-large {
  display: block;
  width: 64px;
  height: 64px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px 64px;
}
.loading-spinner-large.inline-block {
  display: inline-block;
}
.loading-spinner-medium {
  display: block;
  width: 48px;
  height: 48px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 48px 48px;
}
.loading-spinner-medium.inline-block {
  display: inline-block;
}
.loading-spinner-small {
  display: block;
  width: 32px;
  height: 32px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 32px 32px;
}
.loading-spinner-small.inline-block {
  display: inline-block;
}
.loading-spinner-tiny {
  display: block;
  width: 16px;
  height: 16px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 16px 16px;
}
.loading-spinner-tiny.inline-block {
  display: inline-block;
}
.ui-site-1 {
  background-color: #535c5c;
}
.ui-site-2 {
  background-color: #7b8748;
}
.ui-site-3 {
  background-color: #af865a;
}
.ui-site-4 {
  background-color: #775759;
}
.ui-site-5 {
  background-color: #c0b18b;
}
.status-bar {
  font-size: 11px;
  color: #847348;
  border-top: 0;
  background-color: #171717;
}
.tab-bar {
  background-color: #1c1c1c;
  border-bottom: 0;
}
.tab-bar .tab {
  color: #c0b18b;
  height: 30px;
  line-height: 30px;
  font-size: 11px;
  border-right: 0;
  background-color: #1c1c1c;
}
.tab-bar .tab.active {
  color: #ae9b6a;
  background-color: #262626;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  top: 50%;
  right: 14px;
  margin-top: -3px;
  border-color: #5f6969;
}
.tab-bar .tab.modified:hover .close-icon {
  color: currentColor;
}
.tab-bar .tab .close-icon:hover {
  color: #ae9b6a;
}
.tab-bar .tab.active .close-icon:hover {
  color: #c0b18b;
}
.tab-bar .tab.is-dragging {
  background: #141414;
  border-color: transparent;
  opacity: .8;
}
.tab-bar .tab.is-dragging .close-icon {
  visibility: hidden;
}
.text-smaller {
  font-size: smaller;
}
.text-subtle {
  color: #847348;
}
.text-highlight {
  color: #ae9b6a;
}
.text-info {
  color: #5f6969;
}
.text-success {
  color: #8a9851;
}
.text-warning {
  color: #b7936b;
}
.text-error {
  color: #866264;
}
.highlight {
  padding: 1px 4px;
  color: #ae9b6a;
  border-radius: 0;
  background-color: #242424;
}
.highlight-info {
  padding: 1px 4px;
  color: #ae9b6a;
  border-radius: 0;
  background-color: #535c5c;
}
.highlight-warning {
  padding: 1px 4px;
  color: #ae9b6a;
  border-radius: 0;
  background-color: #d17b49;
}
.highlight-error {
  padding: 1px 4px;
  color: #ae9b6a;
  border-radius: 0;
  background-color: #4a3637;
}
.highlight-success {
  padding: 1px 4px;
  color: #ae9b6a;
  border-radius: 0;
  background-color: #6d715e;
}
.background-message {
  font-weight: bold;
  color: #847348;
}
.tooltip .tooltip-inner {
  line-height: 1;
  padding: .75em;
  white-space: nowrap;
  max-width: none;
}
.tooltip .keystroke {
  padding: .15em .4em;
  margin: 0 -0.3em 0 0.25em;
  border-radius: 2px;
  color: #ae9b6a;
  background: #313131;
}
.tree-view-resizer {
  border-right: 1px solid #030303;
}
.tree-view {
  color: #c0b18b;
  background-color: #171717;
}
.tree-view .list-item.selected {
  color: #ae9b6a;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar {
  width: 10px;
  height: 10px;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-track {
  background-color: #171717;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb {
  background-color: #1f1f1f;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-corner {
  background-color: #171717;
}
